u8 = var_0_5.UTF8

function loadNotifyes()
    var_0_52.list = {}
    if not NOTIFY_URL or NOTIFY_URL:isSpace() then return end
    asyncHttpRequest("GET", NOTIFY_URL, { timeout = 10, headers = { ["accept"] = "application/json" } }, function(res)
        if res.status_code ~= 200 then return end
        local txt = res.text:gsub("^\239\187\191", "")  -- óáèðàåì BOM
        local ok, data = pcall(decodeJson, txt)
        if not ok or type(data) ~= "table" then return end
        for _, item in ipairs(data) do
            if type(item) == "table" then
                local icon = (type(item.icon) == "string" and fa[item.icon] ~= "?" and item.icon) or "CIRCLE_INFO"
                if type(item.title) == "string" then
                    title = u8:decode(item.title)  -- ? èñïîëüçóåì :decode
                end

                local content = {}
                if type(item.content) == "table" then
                    for _, line in ipairs(item.content) do
                        if type(line) == "string" then
                            table.insert(content, u8:decode(line))  -- ? äåêîäèðóåì êàæäóþ ñòðîêó
                        elseif type(line) == "number" then
                            table.insert(content, u8:decode(tostring(line)))
                        else
                            table.insert(content, "")
                        end
                    end
                end

                table.insert(var_0_52.list, {
                    date = type(item.date) == "number" and item.date or os.time(),
                    readed = false,
                    icon = icon,
                    title = title,
                    content = content,
                    hovered = false,
                    timer = 0
                })
            end
        end
    end, function() end)
end

