function getIpInfoSync(ip)
    local result = {
        ok = false,
        ip = ip,
        as = "Íåèçâåñòíî",
        country = "Íåèçâåñòíî",
        city = "Íåèçâåñòíî",
        region = "Íåèçâåñòíî",
        lat = 0,
        lon = 0,
