    end

    var_0_21.netlog(0, "IP INFO", "Çàïðîñ (sync) ê ip-api: " .. ip)
    
    local url = ("http://ip-api.com/json/%s?fields=status,message,country,city,regionName,lat,lon,as,isp,org,proxy,mobile,hosting,query"):format(ip)
