        var_0_21.netlog(2, "IP INFO", "Îøèáêà îòâåòà: " .. tostring(data and data.message))
        return result
            end
            
    result.country = data.country or result.country
    result.city = data.city or result.city
    result.region = data.regionName or result.region
    result.lat = tonumber(data.lat) or 0
    result.lon = tonumber(data.lon) or 0

    local as_name = data["as"] or data.isp or data.org
    if type(as_name) == "string" and as_name ~= "" then
        result.as = as_name
    end

    result.proxy = data.proxy or data.hosting or false
    result.mobile = data.mobile or false
                result.ok = true

    var_0_21.netlog(1, "IP INFO", "OK (sync): " .. result.country .. ", " .. result.city)
    
    return result
end

